        private void textBox_currentDomainPage_KeyPress(object sender, KeyPressEventArgs e)
        {
            if (!(e.KeyChar >= '0' && e.KeyChar <= '9') && !(e.KeyChar == '\r') && !(e.KeyChar == 8))
            {
                e.Handled = true;
            }
            else
            {
                e.Handled = false;
            }

            // 回车
            if (e.KeyChar == '\r')
            {
                int nSupportPage = 0;
                bool isParsable = Int32.TryParse(textBox_currentDomainPage.Text, out nSupportPage);
                if (!isParsable)
                {
                    nSupportPage = 0;
                }
                if (nSupportPage >= g_DomainPage) { nSupportPage = g_DomainPage; }
                if (nSupportPage <= 1) { nSupportPage = 1; }

                g_DomainCurrentPage = nSupportPage;

                int nCount = initDomain();
                if (nCount >= 0)
                {
                    g_DomainCount = nCount;
                    if (g_DomainCount % g_DomainPageSize == 0)
                    {
                        g_DomainPage = g_DomainCount / g_DomainPageSize;
                    }
                    else
                    {
                        g_DomainPage = g_DomainCount / g_DomainPageSize + 1;
                    }

                    updateTotalDomainUI();
                    getPageDomain();
                    udpdatePageDomainUI();
                }
            }
        }

