        private void textBox_currentCPPage_KeyPress(object sender, KeyPressEventArgs e)
        {
            if (!(e.KeyChar >= '0' && e.KeyChar <= '9') && !(e.KeyChar == '\r') && !(e.KeyChar == 8))
            {
                e.Handled = true;
            }
            else
            {
                e.Handled = false;
            }

            // 回车
            if (e.KeyChar == '\r')
            {
                int nSupportPage = 0;
                bool isParsable = Int32.TryParse(textBox_currentCPPage.Text, out nSupportPage);
                if (!isParsable)
                {
                    nSupportPage = 0;
                }
                if (nSupportPage >= g_CPPage) { nSupportPage = g_CPPage; }
                if (nSupportPage <= 1) { nSupportPage = 1; }

                g_CPCurrentPage = nSupportPage;

                int nCount = initCP();
                if (nCount >= 0)
                {
                    g_CPCount = nCount;
                    if (g_CPCount % g_CPPageSize == 0)
                    {
                        g_CPPage = g_CPCount / g_CPPageSize;
                    }
                    else
                    {
                        g_CPPage = g_CPCount / g_CPPageSize + 1;
                    }
                    updateTotalCPUI();
                    getPageCP();
                    udpdatePageCPUI();
                }
            }
        }

